  true,\n\t\"url\": null,\n\t\"notes\": \"The Post-Deployment Health Strategic Healthcare
  Group (PDHSHG) Registry System of Records is the information system encompassing
  the Ionizing Radiation Registry (IRR), the Agent Orange Registry (AOR), and the
  Gulf War Registry (GWR) which also includes related Depleted Uranium (DU) exams.
  The AOR area of the PDH database contains VA entered information about U.S. Veterans
  who served in the Republic of Vietnam between 1962 and 1975, in Korea between April
  1968 and August 1971, or who had a registry exam because of possible exposure to
  dioxin or another toxic substance in an herbicide during the conduct of, or as a
  result of, the testing, transporting, or spraying of herbicides for military purposes.\",\n\t\"license_title\":
